import React from 'react';

function Home() {
    return (
        <div className={'content'}>
            <div className={'opacity_wrapper'}>
                <div className={'flex'}>
                    <div className={'white_box'}>Hi there</div>
                    <div>
                        <h1>Hello, Nikita!</h1>
                        <p>Glad to see you today, hope you're feel good.</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
